import React, {Component} from 'react';
import Todo from "../Todo/Todo";
import PropsTypes from ''
import './LIst.css'
class List extends Component {
    render() {
        const {Up_data_todos,todos}=this.props
        return (
            <ul className="todo-main">
                {
                    todos.map(todo=>{
                        return <Todo key={todo.id} {...todo} Up_data_todos={Up_data_todos} />
                    })
                }
            </ul>
        );
    }
}

export default List;
